define({"topics":[{"title":"Accessing your personal room","shortdesc":"<p class=\"shortdesc\">The first time you log in as an authenticated user, a personal room is created for         you. A personal room is a unique and secure room that is permanently reserved for you. <\/p>","href":"t_personal_room.html","attributes":{"data-id":"t_personal_room"},"menu":{"hasChildren":false},"tocID":"t_personal_room-d451e286","topics":[]},{"title":"Starting an instant meeting","shortdesc":"<p class=\"shortdesc\"> By default, anyone with the meeting link can access an instant meeting. All instant     meetings are added to the <span class=\"ph uicontrol\">Recent<\/span> tab in your Meetings homepage. Since     instant meetings are not owned or moderated, any authenticated user can start an existing     instant meeting. <\/p>","href":"generate_meetings.html","attributes":{"data-id":"generate_meetings.dita"},"menu":{"hasChildren":false},"tocID":"generate_meetings.dita-d451e305","topics":[]},{"title":"Creating a new meeting","shortdesc":"<p class=\"shortdesc\">Because meetings are configurable, user access and capability vary depending on how         the meeting is created. Some moderated meetings are configured to restrict guest access.         This topic covers the basic steps on how to create a new meeting. To learn how to manage         your meetings, refer to the <a class=\"xref\" href=\"participant_list.html\">participant_list.html<\/a> section. <\/p>","href":"t_create_moderated.html","attributes":{"data-id":"t_create_moderated"},"menu":{"hasChildren":false},"tocID":"t_create_moderated-d451e327","topics":[]}]});